import React from "react";

const Expense = React.lazy(() => import("../Expense"));
const Expenses = React.lazy(() => import("../pages/Expenses"));
const WrapperView = React.lazy(() => import("../WrapperView"));
const TollEdit = React.lazy(() => import("../edit/TollEdit"));

const Routes = [
  {
    path: "/new",
    exact: true,
    component: Expense
  },
  {
    path: "/expenses",
    exact: true,
    component: Expenses
  },
  {
    path: "/tolls/:id/view",
    exact: true,
    component: (props) => <WrapperView expenseType={"tolls"} edit={true} {...props} />
  },
  // {
  //   path: "/tolls/:id/edit",
  //   exact: true,
  //   component: (props) => <Expense edit={true} {...props} />
  // },
  {
    path: "/tolls/:id/edit",
    exact: true,
    component: (props) => <TollEdit edit={true} {...props} />
  },

  // {
  //   path: "/toll/:id/view",
  //   exact: true,
  //   component: (props) => <Expense edit={true} {...props} />
  // }

];
export default Routes;
